sys_variable_value.value:
(function execute(inputs, outputs) {
    // Get the name input from Flow
    var inputName = inputs.advisorname;

    // Create GlideRecord for the advisor information table
    var advisorGR = new GlideRecord('x_snc_ai_agents_0_advisor_information');

    // Query where 'representative_name' matches the input name
    if (advisorGR.get('representative_name', inputName)) {
        outputs.record = advisorGR.getUniqueValue(); // Return sys_id of matching record
    } else {
        outputs.record = ''; // Return empty if no match
    }
})(inputs, outputs);

